css:
.term2 .terminal {
  font-family: Menlo, Monaco, Inconsolata, monospace;
  padding: 0;
  font-size: 14px;
}
.term2 .terminal > div {
  height: 16px;
  line-height: 16px;
}
.term2 .terminal > div > span {
  display: inline-block;
  line-height: inherit;
  height: inherit;
  font-weight: normal !important;
}
.term2 .terminal .terminal-cursor {
  background-color: #fff;
}
.term2 .terminal span {
  white-space: pre;
}
